import React from 'react';
import SwContext from '../swContex';

function Filtros() {
  return (
    <SwContext.Consumer>
      { ({
        filterByNumericValues,
      }) => (
        filterByNumericValues.map((filter) => (
          <span key={ index }>
            { filter.column }
            {' '}
            { filter.operando }
            {' '}
            { filter.operador}
          </span>
        ))
      ) }
    </SwContext.Consumer>
  );
}

export default Filtros;
